import * as React from 'react';
import Header from '../../header/Header';

const About = () => {
    return(
        <div>
            <Header />
            <ul>
                <li>
                    Eryk Liszewski
                    <ul>
                        <li href="https://github.com/eliszewski">Github profile</li>
                    </ul>
                </li>
            </ul>
        </div>
    )
}

export default About;
